import React from 'react';
import CustomModal from '../../mainModal/MainModal';
import AddBoard from 'components/AddBoard/AddBoard';
import { CloseModalCross } from '../../mainModal/CloseModal';
import {
  ModalContainer,
  ModalTitle,
  ModalHeader,
} from '../EditProfileModal/EditProfileModal.styled';

const AddBoardModal = ({ modalIsOpen, closeModal }) => {
  return (
    <>
      <CustomModal modalIsOpen={modalIsOpen} closeModal={closeModal} />
      <ModalContainer
        sx={{
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          boxShadow: '0 1px 3px 0 rgba(0, 0, 0, 0.1)',
        }}
      >
        <ModalHeader>
          <ModalTitle>New board</ModalTitle>
          <CloseModalCross />
        </ModalHeader>
        <AddBoard />
      </ModalContainer>
    </>
  );
};

export default AddBoardModal;
